ubtype":"command","commandType":"auto","position":10.0,"command":"from pyspark.ml.evaluation import RegressionEvaluator\n\nevaluator = RegressionEvaluator()\n\ndef calc_RMSE(dataset):\n  \"\"\" Calculates root mean squared error for a dataset of (prediction, label) tuples.\n  \n  Args:\n    dataset (Dataframe of (float, float)): A Dataframe consisting of (prediction, label) tuples.\n  \n  Returns:\n    float: The square root of the mean of the squared errors.\n  \"\"\"\n  return evaluator.evaluate(dataset)","commandVersion":0,"state":"finished","results":{"type":"html","data":"<div class=\"ansiout\"></div>","arguments":{},"addedWidgets":{},"removedWidgets":[]},"errorSummary":null,"error":null,"workflows":[],"startTime":1.482088801693E12,"submitTime":1.482088801684E12,"finishTime":1.482088801823E12,"collapsed":false,"bindings":{},"inputWidgets":{},"displayType":"table","width":"auto","height":"auto","xColumns":null,"yColumns":null,"pivotColumns":null,"pivotAggregation":null,"customPlotOptions":{},"commentThread":[],"commentsVisible":false,"parentHierarchy":[],"diffInserts":[],"diffDeletes":[],"globalVars":{},"latestUser":"a user","commandTitle":"","showCommandTitle":false,"hideCommandCode":false,"hideCommandResult":false,"iPythonMetadata":null,"streamStates":{},"nuid":"8ae7343c-a0b7-44bc-a6c0-a97f6d365a2f"},{"version":"CommandV1","origId":396518552778605,"guid":"75b41336-f979-44cd-9600-e90327f21776","subtype":"command","commandType":"auto","position":11.0,"command":"# lets test the function.\npreds_labels = [(1.,2.), (2.,2.), (2.,3.)]\npreds_labels_df = sqlContext.createDataFrame(preds_labels, [\"prediction\", \"label\"])\n\npred_RMSE = calc_RMSE(preds_labels_df)\n# RMSE = sqrt[((1-2)^2 + (2-2)^2 + (2-3)^2) / 3] = 0.81\nprint pred_RMSE","commandVersion":0,"state":"finished","results":{"type":"html","data":"<div class=\"ansiout\">0.816496580928\n</div>","arguments":{},"addedWidgets":{},"removedWidgets":[]},"errorSummary":null,"error":null,"workflows":[],"startTime":1. MSE(preds_labels_train_df)\n\npreds_labels_val = parsed_val_data_df.map(lambda x : (average_train_year, x.label))\npreds_labels_val_df = sqlContext.createDataFrame(preds_labels_val, [\"prediction\", \"label\"])\nrmse_val_base = calc_RMSE(preds_labels_val_df)\n\npreds_labels_test = parsed_test_data_df.map(lambda x : (average_train_year, x.label))\npreds_labels_test_df = sqlContext.createDataFrame(preds_labels_test, [\"prediction\", \"label\"])\nrmse_test_base = calc_RMSE(preds_labels_test_df)\n\nprint 'Baseline Train RMSE = {0:.3f}'.format(rmse_train_base)\nprint 'Baseline Validation RMSE = {0:.3f}'.format(rmse_val_base)\nprint 'Baseline Test RMSE = {0:.3f}'.format(rmse_test_base)","commandVersion":0,"state":"finished","results":{"type":"html","data":"<div class=\"ansiout\">Baseline Train RMSE = 21.256\nBaseline Validation RMSE = 22.231\nBaseline Test RMSE = 21.939\n</div>","arguments":{},"addedWidgets":{},"removedWidgets":[]},"errorSummary":null,"error":null,"workflows":[],"startTime":1.48208880988E12,"submitTime":1.482088809874E12,"finishTime":1.482088811499E12,"collapsed":false,"bindings":{},"inputWidgets":{},"displayType":"table","width":"auto","height":"auto","xColumns":null,"yColumns":null,"pivotColumns":null,"pivotAggregation":null,"customPlotOptions":{},"commentThread":[],"commentsVisible":false,"parentHierarchy":[],"diffInserts":[],"diffDeletes":[],"globalVars":{},"latestUser":"a user","commandTitle":"","showCommandTitle":false,"hideCommandCode":false,"hideCommandResult":false,"iPythonMetadata":null,"streamStates":{},"nuid":"4355473b-d86e-424a-865b-d355ce5819dd"},{"version":"CommandV1","origId":396518552778609,"guid":"98a24eff-1fad-46c2-a56b-ab393550730a","subtype":"command","commandType":"auto","position":11.875,"command":"%md\nNow let's see if we can do better via linear regression, training a model via gradient descent (we'll omit the intercept for now). Recall that the gradient descent update for linear regression is:\n\\\\[ \\scriptsize \\mathbf{w}_{i+1} = \\mathbf{w}_i - \\alpha_i \\sum_j (\\mathbf{w}_i^\\top\\mathbf{x}_j  - y_j) \\mathbf{x}_j \\,.\\\\]\nwhere \\\\( \\scriptsize i \\\\) is the iteration number of the gradient descent algorithm, and \\\\( \\scriptsize j \\\\) identifies the observation.\n\nFirst, we implement a function that computes the summand for this update, i.e., the summand equals \\\\( \\scriptsize (\\mathbf{w}^\\top \\mathbf{x} - y) \\mathbf{x} \\, ,\\\\) and test out this function on two examples.","commandVersion":0,"state":"finished","results":null,"errorSummary":null,"error":null,"workflows":[],"startTime":0.0,"submitTime":0.0,"finishTime":0.0,"collapsed":false,"bindings":{},"inputWidgets":{},"displayType":"table","width":"auto","height":"auto","xColumns":null,"yColumns":null,"pivotColumns":null,"pivotAggregation":null,"customPlotOptions":{},"commentThread":[],"commentsVisible":false,"parentHierarchy":[],"diffInserts":[],"diffDeletes":[],"globalVars":{},"latestUser":"a user","commandTitle":"","showCommandTitle":false,"hideCommandCode":false,"hideCommandResult":false,"iPythonMetadata":null,"streamStates":{},"nuid":"becde9a5-c80b-45e9-b264-2e87e4f4288c"},{"version":"CommandV1","origId":396518552778610,"guid":"41426e6c-594b-47db-82dd-33b7636f1da9","subtype":"command","commandType":"auto","position":11.9375,"command":"from pyspark.mllib.linalg import DenseVector\n\ndef gradient_summand(weights, lp):\n  \"\"\"Calculates the gradient summand for a given weight and LabeledPoint.\n  \n  Args:\n    weights(DenseVector): An array of model weights(betas).\n    lp(LabeledPoint): The LabeledPoint for a single observation.\n  \n  Returns:\n    DenseVector: An array of values the same length as weights. The gradient summand.\n  \"\"\"\n  gradient_summand = ((weights.transpose().dot(lp.features)) - lp.label) * (lp.features)\n  return gradient_summand","commandVersion":0,"state":"finished","results":{"type":"html","data":"<div class=\"ansiout\"></div>","arguments":{},"addedWidgets":{},"removedWidgets":[]},"errorSummary":null,"error":null,"workflows":[],"startTime":1.482088816093E12,"submitTime":1.482088816083E12,"finishTime":1.482088816158E12,"collapsed":false,"bindings":{},"inputWidgets":{},"displayType":"table","width":"auto","height":"auto","xColumns":null,"yColumns":null,"pivotColumns":null,"pivotAggregation":null,"customPlotOptions":{},"commentThread":[],"commentsVisible":false,"parentHierarchy":[],"diffInserts":[],"diffDeletes":[],"globalVars":{},"latestUser":"a user","commandTitle":"","showCommandTitle":false,"hideCommandCode":false,"hideCommandResult":false,"iPythonMetadata":null,"streamStates":{},"nuid":"a498b1fb-2daf-4c56-95de-cae159a9039f"},{"version":"CommandV1","origId":396518552778611,"guid":"77f8c535-acae-497e-9af3-066ae518a348","subtype":"command","commandType":"auto","position":11.96875,"command":"# test gradient summand function.\n\nexample_weights = DenseVector([1,1,1])\nexample_lp = LabeledPoint(3.0, [2, 3, 4])\nsummand_example = gradient_summand(example_weights, example_lp)\nprint summand_example","commandVersion":0,"state":"finished","results":{"type":"html","data":"<div class=\"ansiout\">[12.0,18.0,24.0]\n</div>","arguments":{},"addedWidgets":{},"removedWidgets":[]},"errorSummary":null,"error":null,"workflows":[],"startTime":1.482088818451E12,"submitTime":1.482088818442E12,"finishTime":1.482088818525E12,"collapsed":false,"bindings":{},"inputWidgets":{},"displayType":"table","width":"auto","height":"auto","xColumns":null,"yColumns":null,"pivotColumns":null,"pivotAggregation":null,"customPlotOptions":{},"commentThread":[],"commentsVisible":false,"parentHierarchy":[],"diffInserts":[],"diffDeletes":[],"globalVars":{},"latestUser":"a user","commandTitle":"","showCommandTitle":false,"hideCommandCode":false,"hideCommandResult":false,"iPythonMetadata":null,"streamStates":{},"nuid":"54dd186f-699e-4267-b535-4070884dac5b"},{"version":"CommandV1","origId":396518552778612,"guid":"fd3b1e87-3044-4b82-ac81-60b6aebaf164","subtype":"command","commandType":"a 9ac0c0c74e2","subtype":"command","commandType":"auto","position":22.0,"command":"best_RMSE = rmse_val_LR1\nbest_reg_param = reg\nbest_model = first_model\n\nnum_iters = 500  # iterations\nalpha = .2  # elasticNetParam\nuse_intercept = True  # intercept\n\nfor reg in [1e-10, 1e-5, 1.0]:\n    lin_reg = LinearRegression(maxIter=num_iters, regParam=reg, elasticNetParam=alpha, fitIntercept=use_intercept)\n    model = lin_reg.fit(parsed_train_data_df)\n    val_pred_df = model.transform(parsed_val_data_df)\n\n    rmse_val_grid = calc_RMSE(val_pred_df)\n    print rmse_val_grid\n\n    if rmse_val_grid < best_RMSE:\n        best_RMSE = rmse_val_grid\n        best_reg_param = reg\n        best_model = model\n\nrmse_val_LR_grid = best_RMSE\n\nprint ('Validation RMSE:\\n\\tBaseline = {0:.3f}\\n\\tLR0 = {1:.3f}\\n\\tLR1 = {2:.3f}\\n' +\n       '\\tLRGrid = {3:.3f}').format(rmse_val_base, rmse_val_LR0, rmse_val_LR1, rmse_val_LR_grid)","commandVersion":0,"state":"finished","results":{"type":"html","data":"<div class=\"ansiout\">16.0769391592\n16.0769608429\n16.2071685831\nValidation RMSE:\n\tBaseline = 22.231\n\tLR0 = 19.526\n\tLR1 = 16.092\n\tLRGrid = 16.077\n</div>","arguments":{},"addedWidgets":{},"removedWidgets":[]},"errorSummary":null,"error":null,"workflows":[],"startTime":1.482089991013E12,"submitTime":1.482089991016E12,"finishTime":1.482089997908E12,"collapsed":false,"bindings":{},"inputWidgets":{},"displayType":"table","width":"auto","height":"auto","xColumns":null,"yColumns":null,"pivotColumns":null,"pivotAggregation":null,"customPlotOptions":{},"commentThread":[],"commentsVisible":false,"parentHierarchy":[],"diffInserts":[],"diffDeletes":[],"globalVars":{},"latestUser":"a user","commandTitle":"","showCommandTitle":false,"hideCommandCode":false,"hideCommandResult":false,"iPythonMetadata":null,"streamStates":{},"nuid":"520cd422-6644-4caf-b7aa-b4944b44ea2f"},{"version":"CommandV1","origId":4192788006954421,"guid":"cf5843d8-0f33-40a2-9b8e-f2ab888142fe","subtype":"command","commandType":"auto","position":23.0,"command":"%md\nSo far, we've used the features as they were provided.  Now, we will add features that capture the two-way interactions between our existing features.","commandVersion":0,"state":"error","results":null,"errorSummary":null,"error":null,"workflows":[],"startTime":0.0,"submitTime":0.0,"finishTime":0.0,"collapsed":false,"bindings":{},"inputWidgets":{},"displayType":"table","width":"auto","height":"auto","xColumns":null,"yColumns":null,"pivotColumns":null,"pivotAggregation":null,"customPlotOptions":{},"commentThread":[],"commentsVisible":false,"parentHierarchy":[],"diffInserts":[],"diffDeletes":[],"globalVars":{},"latestUser":"a user","commandTitle":"","showCommandTitle":false,"hideCommandCode":false,"hideCommandResult":false,"iPythonMetadata":null,"streamStates":{},"nuid":"78d49b37-f95d-45e6-8c89-2d78ce476098"},{"version":"CommandV1","origId":4192788006954422,"guid":"898277ee-0c54-459e-a62a-b69c0794ac56","subtype":"command","commandType":"auto","position":24.0,"command":"import itertools\n\ndef two_way_interactions(lp):\n    \"\"\"Creates a new `LabeledPoint` that includes two-way interactions.\n    \n    Args:\n        lp (LabeledPoint): The label and features for this observation.\n\n    Returns:\n        LabeledPoint: The new `LabeledPoint` should have the same label as `lp`.  Its features\n            should include the features from `lp` followed by the two-way interaction features.\n    \"\"\"\n    combinations = itertools.product(lp.features, repeat = 2)\n    list_combs = []\n    final_list = [lp.label]\n    for y in lp.features:\n      list_combs.append(y)\n    for x in combinations:\n      prods = np.prod(np.array(x))\n      list_combs.append(prods)\n    final_list.append(list_combs)\n    lbp = LabeledPoint(label=final_list[0], features=final_list[1])\n    return lbp\n\nprint two_way_interactions(LabeledPoint(0.0, [2, 3]))","commandVersion":0,"state":"finished","results":{"type":"html","data":"<div class=\"ansiout\">(0.0,[2.0,3.0,4.0,6.0,6.0,9.0])\n</div>","arguments":{},"addedWidgets":{},"removedWidgets":[]},"errorSummary":null,"error":null,"workflows":[],"startTime":1.482090150155E12,"submitTime":1.482090150132E12,"finishTime":1.482090150227E12,"collapsed":false,"bindings":{},"inputWidgets":{},"displayType":"table","width":"auto","height":"auto","xColumns":null,"yColumns":null,"pivotColumns":null,"pivotAggregation":null,"customPlotOptions":{},"commentThread":[],"commentsVisible":false,"parentHierarchy":[],"diffInserts":[],"diffDeletes":[],"globalVars":{},"latestUser":"a user","commandTitle":"","showCommandTitle":false,"hideCommandCode":false,"hideCommandResult":false,"iPythonMetadata":null,"streamStates":{},"nuid":"d7838c72-4364-4258-ab69-193c1b5a27da"},{"version":"CommandV1","origId":4192788006954423,"guid":"55289b3d-8a47-4928-8a8e-90999ce41419","subtype":"command","commandType":"auto","position":25.0,"command":"# Transform the existing train, validation, and test sets to include two-way interactions.\ntrain_data_interact_df = parsed_train_data_df.map(two_way_interactions).toDF()\nval_data_interact_df = parsed_val_data_df.map(two_way_interactions).toDF()\ntest_data_interact_df = parsed_test_data_df.map(two_way_interactions).toDF()\na=parsed_val_data_df.rdd.first()\nprint a.features\nf=two_way_interactions(LabeledPoint(a.label, a.features)).features\nprint sum(f)","commandVersion":0,"state":"finished","results":{"type":"html","data":"<div class=\"ansiout\">[0.23334012715,0.263998494663,0.172456393506,0.202630177209,0.408074143319,0.27991750521,0.33084776778,0.484381714768,0.575929243147,0.466373547303,0.437323059783,0.439468354693]\n22.7395367359\n</div>","arguments":{},"addedWidgets":{},"removedWidgets":[]},"errorSummary":null,"error":null,"workflows":[],"startTime":1.482090182299E12,"submitTime":1.4820901823E12,"finishTime":1.482090182521E12,"collapsed":false,"bindings":{},"inputWidgets":{},"displayType":"table","width":"auto","height":"auto","xColumns":null,"yColumns":null,"pivotColumns":null,"pivotAggregation":null,"customPlotOptions":{},"commentThread":[],"commentsVisible":false,"parentHierarchy":[],"diffInserts":[],"diffDeletes":[],"globalVars":{},"latestUser":"a user","commandTitle":"","showCommandTitle":false,"hideCommandCode":false,"hideCommandResult":false,"iPythonMetadata":null,"streamStates":{},"nuid":"822d45ae-8225-48aa-91f1-d60639fdc041"},{"version":"CommandV1","origId":4192788006954424,"guid":"ac88e660-9fd3-4030-b9bc-fe98cf242203","subtype":"command","commandType":"auto","position":26.0,"command":"# lets build the interaction model\nnum_iters = 500\nreg = 1e-10\nalpha = .2\nuse_intercept = True\n\nlin_reg = LinearRegression(maxIter=num_iters, regParam=reg, elasticNetParam=alpha, fitIntercept=use_intercept)\nmodel_interact = lin_reg.fit(train_data_interact_df)\npreds_and_labels_interact_df = model_interact.transform(val_data_interact_df)\nrmse_val_interact = calc_RMSE(preds_and_labels_interact_df)\n\nprint ('Validation RMSE:\\n\\tBaseline = {0:.3f}\\n\\tLR0 = {1:.3f}\\n\\tLR1 = {2:.3f}\\n\\tLRGrid = ' +\n       '{3:.3f}\\n\\tLRInteract = {4:.3f}').format(rmse_val_base, rmse_val_LR0, rmse_val_LR1,\n                                                 rmse_val_LR_grid, rmse_val_interact)","commandVersion":0,"state":"finished","results":{"type":"html","data":"<div class=\"ansiout\">Validation RMSE:\n\tBaseline = 22.231\n\tLR0 = 19.526\n\tLR1 = 16.092\n\tLRGrid = 16.077\n\tLRInteract = 15.436\n</div>","arguments":{},"addedWidgets":{},"removedWidgets":[]},"errorSummary":null,"error":null,"workflows":[],"startTime":1.482090211412E12,"submitTime":1.482090211416E12,"finishTime":1.482090252563E12,"collapsed":false,"bindings":{},"inputWidgets":{},"displayType":"table","width":"auto","height":"auto","xColumns":null,"yColumns":null,"pivotColumns":null,"pivotAggregation":null,"customPlotOptions":{},"commentThread":[],"commentsVisible":false,"parentHierarchy":[],"diffInserts":[],"diffDeletes":[],"globalVars":{},"latestUser":"a user",
